import React from "react";
import s from "./Card.module.css";

export default function CardInfo({ header, text, link, extraClass }) {
  return (
    <div className={extraClass}>
      <p className={s.CardInfoHeader}>{header}</p>
      <p className={s.CardInfoText}>
        {text}
        {"\n"}
        {link}
      </p>
    </div>
  );
}
